import React from 'react';
import { Text, View } from 'react-native';

function Classroom() {
  return (
    <View style={{ backgroundColor: '#33E6FA', flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text style={{fontSize:20,fontWeight:"bold"}}>Classroom</Text>
    </View>
  );
}

export default Classroom;
